Now let's demonstrate some boxes with some labels. import fabric # importing the base pacakge
from fabric.widgets.window import Window # grabs the Window class from Fabric
from fabric.widgets.box import Box # gets the Box class
from fabric.widgets.label import Label # gets the Label class box_1 = Box( orientation="v", children=Label("this is the first box")
)
box_2 = Box( orientation="h", spacing=28, # adds some spacing between the children children=[ Label("this is the first element in the second box"), Label("btw, this box elements will get added horizontally") ]
) box_1.add(box_2) window = Window( children=box_1 # there's no need showing this window using `show_all()`; it'll show them itself because the children are already passed
) fabric.start() Result (notice the alignment of the labels): Here's a visual representation for more clarity: You probably now have an understanding of how box containers can work with different orientations. Let's keep going.
